	def learningStandard = new JsonBuilder(slurped.LearningStandards.LearningStandard[i])
	def lsTitle = learningStandard.content.Title

	// Update Fields
	slurped.LearningStandards.LearningStandard[i].Title = "$lsTitle" + "_" + "$dynamicId"
